import React, { Component } from "react";
import Navbar from "../Navbar";
import '../Inthewomb/Pregnancybyweek.css';
import Slider1 from '../images/Inthewomb_banner.jpg';
import week_1_pregnant from '../images/Pregnancy by week/1-week-pregnant.png';
import Footer from '../Footer';
import Card from "react-bootstrap/Card";
import { ListGroupItem } from "react-bootstrap";
import { ListGroup } from "react-bootstrap";



function Pregnancybyweek() {
    return (
        <>
<Navbar/>

<div id="carouselExampleCaptions" className="my-carousel carousel slide" data-bs-ride="carousel"> 
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img src={Slider1} className="d-block w-100" height="100%" alt="..."/>
            <div className="carousel-caption d-none d-md-block">
              <h5>Pregnancy Week By Week</h5>
              <p>Get Updates on baby's development, decode your pregnancy Symptoms and see your weekly to-dos.</p>
              <div className="slider-btn">
                  <button className="btn btn-1">Read More</button>
              </div>
            </div>
          </div>  
        </div>
      </div>

  <h className="main-head2">More Resources You'll Love</h>
      <Card style={{ width: '18rem' }}><Link to="/baby">
  <Card.Img variant="top" src={week_1_pregnant} />
  <Card.Body>
    <Card.Title>Card Title</Card.Title>
    <Card.Text>
      Some quick example text to build on the card title and make up the bulk of
      the card's content.
    </Card.Text>
  </Card.Body>
  </Link>

  <Card.Body>
    <Card.Link href="#">Card Link</Card.Link>
    <Card.Link href="#">Another Link</Card.Link>
  </Card.Body>
</Card>

      <Footer />
</>
    );
}

export default Pregnancybyweek;
